// --- device tilt (accelerometer) for mobile water overflow ---
var tiltLR = 0;       // -1..1 (left..right)
var tiltActive = 0;   // 0/1
var tiltLastTs = 0;
var tiltBound = false;
var tiltListening = false;
var tiltHandler = null;

// controlled via settings (0..3)
var cfg_tilt_level = 0;

function tiltStrengthMul() {
  if (cfg_tilt_level === 1) return 0.70;
  if (cfg_tilt_level === 2) return 1.05;
  if (cfg_tilt_level === 3) return 1.45;
  return 0;
}

function stopDeviceTilt() {
  if (!tiltListening) return;
  tiltListening = false;
  try { window.removeEventListener('deviceorientation', tiltHandler, true); } catch (e) {}
  tiltLR = 0;
  tiltActive = 0;
}

function bindDeviceTilt() {
  // Bind only when enabled in settings — important for iOS (permission prompt).
  if (tiltBound) return;
  if (!cfg_tilt_level) return;

  tiltBound = true;

  // only for phones/tablets; skip on Tizen and desktop
  if (isTizen()) return;
  if (!isMobileUA()) return;

  tiltHandler = function (ev) {
    if (!cfg_tilt_level) return;
    if (!ev) return;
    var g = ev.gamma; // left-right tilt (degrees), positive -> right side down
    if (typeof g !== 'number') return;

    // stronger normalization for better visibility on phones
    var target = clamp(g / 22, -1, 1) * tiltStrengthMul();

    // deadzone (reduce micro jitter)
    if (Math.abs(target) < 0.03) target = 0;

    // low-pass, faster response than before
    tiltLR = tiltLR * 0.80 + target * 0.20;

    tiltActive = 1;
    tiltLastTs = Date.now();
  };

  function start() {
    if (tiltListening) return;
    tiltListening = true;
    try { window.addEventListener('deviceorientation', tiltHandler, true); } catch (e) {}
  }

  // iOS may require permission (best-effort)
  try {
    if (window.DeviceOrientationEvent && typeof DeviceOrientationEvent.requestPermission === 'function') {
      var asked = false;
      var req = function () {
        if (asked) return;
        if (!cfg_tilt_level) return;
        asked = true;

        try {
          DeviceOrientationEvent.requestPermission().then(function (res) {
            if (res === 'granted') start();
          }).catch(function () {});
        } catch (e1) {}

        try { window.removeEventListener('click', req, true); } catch (e2) {}
        try { window.removeEventListener('touchend', req, true); } catch (e3) {}
      };

      try { window.addEventListener('click', req, true); } catch (e4) {}
      try { window.addEventListener('touchend', req, true); } catch (e5) {}

      // also start immediately where permission isn't required
      start();
      return;
    }
  } catch (e6) {}

  start();
}

function updateTiltBinding() {
  if (!cfg_tilt_level) {
    stopDeviceTilt();
    return;
  }
  // if not yet bound, bind now
  if (!tiltBound) bindDeviceTilt();
}

